 @Marcus Bullock  All of that is right, but when making Donkey Kong Country Rare didn't sit down and say, lets make a masterpiece of art, they said lets make a game to entertain children. 

Childrens games can be difficult, beautiful and  appeal to fans from an older generation, but that doesn't change that fact that they are still a children's toy.

I own a very expensive Yo Yo. Its a gorgeous work of human ingenuity, the tricks you can learn with it could dazzle an audience and would be basically impossible to learn by a child, it can also be used as a very good self defense tool as its a pretty heavy chuck of metal. All of that doesn't change the fact that its still a childs toy.
